import React from "react";
import {
  IconButton,
  InputAdornment,
  Grid,
  DialogContent,
  Paper,
  makeStyles,
  TextField,
  Button,
} from "@material-ui/core";
import { IDialogeDataMobile } from "./appFolder-Interfaces";

function MobileModalLog(DialogeDataMobile: IDialogeDataMobile) {
  ///
  ///
  ///
  /// MATERIAL UI  CUSTOM STYLES
  var useStyleModal = makeStyles(() => ({
    containerStyle: {
      width: DialogeData.imageReal,
      height: "auto",
      boxShadow: "0 5px 16px rgba(0, 0, 0, 0.2)",
      color: "#000000",
      position: "relative",
      zIndex: 10,
      borderRadius: DialogeData.borderGrid,
    },
    imageStyle: {
      opacity: DialogeData.opacityFixedModalImage,
      cursor: "pointer",
      objectFit: "cover",
      width: "100%",
      height: "100%",
      borderRadius: "0px",
      borderTopLeftRadius: DialogeData.borderGrid,
      borderBottomLeftRadius: DialogeData.borderGrid,
      background: "#000000",
    },
    imageStylex: {
      opacity: DialogeData.opacitySlidingModalImage,
      cursor: "pointer",
      width: "100%",
      height: "auto",
      borderRadius: "0px",
      background: "#000000",
    },
  }));
  var classes = useStyleModal();
  return (
    <DialogContent
      className="fadermodal FormDialog-container dontallowhighlighting"
      onClick={DialogeDataMobile.onBackgroundFocus}
      style={{ overflow: "hidden", cursor: "pointer" }}
      ref={DialogeDataMobile.ModalBackgroundRef}
    >
      <img
        onClick={DialogeDataMobile.zoomlogmodal}
        onLoad={DialogeDataMobile.onimageload}
        src={DialogeDataMobile.showimage}
        className={classes.imageStyle}
        alt="Logsmall"
      />
    </DialogContent>
  );
}

export default MobileModalLog;
